pergunta principal: Recebi auxílio-doença e voltei a trabalhar, mas fiquei com sequelas. Tenho direito ao auxílio-acidente?
perguntas relacionadas: O que é auxílio-acidente?


Como comprovar sequela?


Posso entrar com pedido após voltar ao trabalho?


O laudo médico serve como prova?


Quais documentos preciso?
resposta: Sim, pode ter direito ao auxílio-acidente. Envie o laudo detalhando a sequela e a gente avalia e prepara o pedido. É comum pedir perícia e documentos para comprovar o nexo com o afastamento.
